Barbara Dickson

Biography Documentary hosted by Mairi Anna Nic Ualraig, published by BBC in 2012 - Gaelic (Scottish) narration. &lt;a href=&quot;
http://docuwiki.net/images/c/c4/Barbara-Dickson-Cover.jpg&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
